import React from "react";

class BackNext extends React.Component {

  BackNext=(e)=>{
    let a=e.target.value 
    this.props.BackNext(a)


      
  }


  render() {
    return (
      <div className="flex pt-10 justify-between">
        <button value='-1' className="bg-white  py-2 px-6 border border-gray-400 rounded shadow" onClick={()=>this.props.BackNext(-1)}>Back</button>
        <button value='1' className="bg-white  py-2 px-6 border border-gray-400 rounded shadow" onClick={()=>this.props.BackNext(1)}>Next</button>
      </div>
    );
  }
}
export default BackNext;
